import React, { Component } from "react";

class Lifecycle extends Component {
  constructor(props) {
    super(props);
    this.state = { name: "siraj" };
    console.log("component initialized");
  }
  componentDidMount() {
    console.log("component mounted");
  }

  render() {
    console.log("render");
    return <div>Hello</div>;
  }
}

export default Lifecycle;
